description:
Supernatural: Beginning's End picks up several years after the Rising Son miniseries.  The Winchester clan find themselves in the strangest situation imaginable - monster hunting in the Big Apple!  The series covers the events that led to Sam leaving his family to attend Stanford University.

Written by show scribes Andrew Dabb and Daniel Loflin and illustrated by Diego Olmos (Majestic).

